import { Button, Typography } from "@mui/material";
import { Box } from "@mui/system";
import { useDispatch, useSelector } from "react-redux";
import { useHistory } from "react-router";
import { LinearProgress } from '@mui/material';
import {handleLimitChange, handleScoreChnage } from "../Redux/action";

const Final = () => {
  const disptach = useDispatch();
  const history = useHistory();
  const { score,question_answers } = useSelector((state) => state);

  const handleBackToSettings = () => {
    disptach(handleScoreChnage(0));
    disptach(handleLimitChange(0));
    history.push("/");
  };
  var percentageValue = ((score/question_answers.l) * 100).toFixed(3);

  return (
    <Box mt={30}>

      <Typography variant="h3" fontWeight="bold" mb={3}>
        Final Score {score}
      </Typography>
      <Typography variant="h3" fontWeight="bold" mb={3}>
      {percentageValue}
      </Typography>
      <Button onClick={handleBackToSettings} variant="outlined">
        back to settings!
      </Button>
    </Box>
  );
};

export default Final;
